import React, { useState } from 'react';
import createPassenger from './createPassenger';

function CreatePassengerForm() {
  const [passengerId, setPassengerId] = useState('');
  const [name, setName] = useState('');
  const [age, setAge] = useState('');
  const [gender, setGender] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await createPassenger(passengerId, name, age, gender);
      alert(`Passenger ${passengerId} created successfully!`);
    } catch (error) {
      alert(`Failed to create passenger: ${error.message}`);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="passengerId">Passenger ID:</label>
        <input
          type="text"
          id="passengerId"
          value={passengerId}
          onChange={(e) => setPassengerId(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="name">Name:</label>
        <input
          type="text"
          id="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="age">Age:</label>
        <input
          type="number"
          id="age"
          value={age}
          onChange={(e) => setAge(e.target.value)}
        />
      </div>
      <div>
        <label htmlFor="gender">Gender:</label>
        <select id="gender" value={gender} onChange={(e) => setGender(e.target.value)}>
          <option value="">--Select--</option>
          <option value="male">Male</option>
          <option value="female">Female</option>
          <option value="other">Other</option>
        </select>
      </div>
      <button type="submit">Create Passenger</button>
    </form>
  );
}

export default CreatePassengerForm;
